import React from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  Database, 
  FileText, 
  Scissors, 
  Calendar, 
  GitBranch, 
  Layers,
  Play,
  CheckCircle,
  Clock,
  AlertCircle
} from 'lucide-react';

const Dashboard: React.FC = () => {
  const navigate = useNavigate();
  
  // Mock data - in real app this would come from API
  const phases = [
    {
      id: 1,
      name: 'Data Ingestion & Analysis',
      description: 'Connect to existing MongoDB, analyze raw data structure, show field statistics',
      icon: Database,
      status: 'pending',
      progress: 0,
      color: 'blue'
    },
    {
      id: 2,
      name: 'Database Normalization',
      description: 'Create clean database structure, normalize statute names, sort alphabetically',
      icon: FileText,
      status: 'pending',
      progress: 0,
      color: 'green'
    },
    {
      id: 3,
      name: 'Field Cleaning & Splitting',
      description: 'Clean fields, remove duplicates, organize sections, bring common fields up',
      icon: Scissors,
      status: 'pending',
      progress: 0,
      color: 'purple'
    },
    {
      id: 4,
      name: 'Date Processing',
      description: 'Extract, parse, and standardize dates using AI and regex',
      icon: Calendar,
      status: 'pending',
      progress: 0,
      color: 'orange'
    },
    {
      id: 5,
      name: 'Statute Versioning',
      description: 'Group statutes by base names, assign versions, remove duplicates',
      icon: GitBranch,
      status: 'pending',
      progress: 0,
      color: 'indigo'
    },
    {
      id: 6,
      name: 'Section Versioning',
      description: 'Split sections, assign versions, create final schema',
      icon: Layers,
      status: 'pending',
      progress: 0,
      color: 'pink'
    }
  ];

  const getStatusIcon = (status: string) => {
    switch (status) {
      case 'completed':
        return <CheckCircle className="h-5 w-5 text-success-600" />;
      case 'in_progress':
        return <Play className="h-5 w-5 text-primary-600" />;
      case 'paused':
        return <Clock className="h-5 w-5 text-warning-600" />;
      case 'failed':
        return <AlertCircle className="h-5 w-5 text-error-600" />;
      default:
        return <Clock className="h-5 w-5 text-gray-400" />;
    }
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'completed':
        return 'bg-success-100 text-success-800';
      case 'in_progress':
        return 'bg-primary-100 text-primary-800';
      case 'paused':
        return 'bg-warning-100 text-warning-800';
      case 'failed':
        return 'bg-error-100 text-error-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div className="space-y-0">
      {/* Header */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-2">
        <h1 className="text-xl font-bold text-gray-900 mb-1">
          LawChronicle Pipeline Dashboard
        </h1>
        <p className="text-gray-600 text-sm">
          Phase 0 Complete - Foundation setup with React.js frontend, FastAPI backend, and MongoDB integration
        </p>
      </div>

      {/* Pipeline Overview */}
      <div className="grid grid-cols-1 lg:grid-cols-2 xl:grid-cols-3 gap-2 mt-2">
        {phases.map((phase) => (
          <div
            key={phase.id}
            className="bg-white rounded-lg shadow-sm border border-gray-200 p-3 hover:shadow-md transition-shadow duration-200"
          >
            <div className="flex items-start justify-between mb-2">
              <div className={`p-2 rounded-lg bg-${phase.color}-100`}>
                <phase.icon className={`h-6 w-6 text-${phase.color}-600`} />
              </div>
              <div className="flex items-center space-x-2">
                {getStatusIcon(phase.status)}
                <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getStatusColor(phase.status)}`}>
                  {phase.status.replace('_', ' ')}
                </span>
              </div>
            </div>

            <h3 className="text-lg font-semibold text-gray-900 mb-1">
              Phase {phase.id}: {phase.name}
            </h3>
            
            <p className="text-gray-600 text-sm mb-2">
              {phase.description}
            </p>

            {/* Progress bar */}
            <div className="mb-2">
              <div className="flex items-center justify-between text-sm text-gray-600 mb-1">
                <span>Progress</span>
                <span>{phase.progress}%</span>
              </div>
              <div className="w-full bg-gray-200 rounded-full h-2">
                <div
                  className={`bg-${phase.color}-600 h-2 rounded-full transition-all duration-300`}
                  style={{ width: `${phase.progress}%` }}
                ></div>
              </div>
            </div>

            {/* Phase 1 & 2 - Available for navigation */}
            {phase.id === 1 ? (
              <button
                onClick={() => navigate('/phase1')}
                className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 transition-colors duration-200"
              >
                <Play className="h-4 w-4 mr-2" />
                Start Phase 1
              </button>
            ) : phase.id === 2 ? (
              <button
                onClick={() => navigate('/phase2')}
                className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-green-600 hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-green-500 transition-colors duration-200"
              >
                <Play className="h-4 w-4 mr-2" />
                Start Phase 2
              </button>
            ) : phase.id === 3 ? (
              <button
                onClick={() => navigate('/phase3')}
                className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md text-white bg-purple-600 hover:bg-purple-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-purple-500 transition-colors duration-200"
              >
                <Play className="h-4 w-4 mr-2" />
                Start Phase 3
              </button>
            ) : (
              <div className="inline-flex items-center px-4 py-2 border border-gray-300 text-sm font-medium rounded-md text-gray-500 bg-gray-100 cursor-not-allowed">
                Phase Not Available
              </div>
            )}
          </div>
        ))}
      </div>

      {/* Quick Actions */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-2 mt-2">
        <h2 className="text-lg font-semibold text-gray-900 mb-1">Quick Actions</h2>
